import Icon from "./Icon";
import {Link} from "react-router-dom";
import React from "react";


const Navi = () =>{
    return(
            <ul>
                <li>
                    <Icon name="home"></Icon>
                    <Link to="/Home">主页</Link>
                </li>
                <li>
                    <Icon name="plus-cross"></Icon>
                    <Link to="/Count">记账</Link>
                </li>
                <li>
                    <Icon name="analysis"></Icon>
                    <Link to="/Statistics">统计</Link>
                </li>
            </ul>
    );
}

export  default  Navi;
